        Dim N1 as INTEGER;
dim N2 as INTEGER;
dim N3 as INTEGER;
N3 = STEP_NO/10; 'NORMALIZED STEP NO.
N1 = trunc((N3-1)/4) +1 ;'NO. OT TIMER BLOCK T1,T2,T3..ETC
N2 = N3 - (4*(N1 -1));'NO OF TIMER IN TIMER BLOCK TIMR1, TIMR2, TIMR3 OR TIMR4


if N3 <= 32 then
SetCustomPropertyValue("DONE","IADAS."+ C + "." + B + "P1.IN" + StringFromIntg(N3,10) ,false);'STEP DONE
ELSE
SetCustomPropertyValue("DONE","IADAS."+ C + "." + B + "P2.IN" + StringFromIntg(N3-32,10) ,false);'STEP DONE
endif;

SetCustomPropertyValue("TIMER","IADAS."+ C + "." + B + "T" + StringFromIntg(N1,10)+ ".TIMR" + StringFromIntg(N2,10)+ "V" ,false);

